import React from 'react';
import SimpleSlider from './simpleSlider';
import { FaArrowLeft, FaArrowRight } from "react-icons/fa";
function App() {
  return (
    <div>
      <h1>Simple Slider</h1>
      <SimpleSlider />
      <div className="custom-arrow next-arrow" onClick={onClick}>
      
    </div>
    </div>
  );
}

export default App;
